import React from 'react';
import {Card,Button,CardDeck,CardColumns} from 'react-bootstrap';
import {Form,FormGroup,Label,Input} from 'reactstrap';
import DatePicker from "react-datepicker";
import './CWO.css';




class CWO extends React.Component{

 constructor(props){
 super(props);
 this.state={
    startDate:null

 }
}

 handleChangeDate = date=>{
    this.setState({startDate:date})

 }

 render(){

    return(
        <div>
            <CardColumns>
                {/* CARD og player One */}
           <Card  border="dark" className="CardBodyCWO">
                <Card.Img variant="top" src="assets/images/CWO.jpg" />
                <Card.Header className="CardtextCWO">Compare Your Analysis !</Card.Header>
                <Card.Body>
                          <Card.Title className="CardtextCWO">Player - 1</Card.Title>
                   <Card.Text>
                        <div>
                            <Form>
                                  <FormGroup>
                                     <Label htmlFor="playername" className="inputTextCWO"><i className="fa fa-user"></i>&nbsp; Player Name</Label>
                                          <Input typr="text" id="=playername"  name="playername" placeholder="Player Name" />
                                 </FormGroup>
                                 <FormGroup>
                                     <Label htmlFor="matchdate" className="inputTextCWO"><i className="fas fa-calendar-week"></i>&nbsp;Match Date - </Label>
                                        &nbsp;&nbsp;
                                          <DatePicker
                                           placeholderText="MM/DD/YYYY"
                                           selected={this.state.startDate}
                                           onChange={this.handleChangeDate}
                                         />        
                                 </FormGroup>
                            </Form>
                       </div>
                    </Card.Text>
                </Card.Body>
        </Card>
        <p>VS</p>
        {/* Card of player One ends */}

        {/* card of player Two  */}
        <Card  border="dark" className="CardBodyCWO1">
            <Card.Img variant="top" src="assets/images/CWO.jpg" />
            <Card.Header className="CardtextCWO">Compare Your Analysis !</Card.Header>
            <Card.Body>
                <Card.Title className="CardtextCWO">Player - 1</Card.Title>
                     <Card.Text>
                        <div>
                              <Form>
                                <FormGroup>
                                    <Label htmlFor="playername" className="inputTextCWO"><i className="fa fa-user"></i>&nbsp; Player Name</Label>
                                         <Input typr="text" id="=playername"  name="playername" placeholder="Player Name" />
                                </FormGroup>
                                <FormGroup>
                                    <Label htmlFor="matchdate" className="inputTextCWO"><i className="fas fa-calendar-week"></i>&nbsp;Match Date - </Label>
                                       &nbsp;&nbsp;
                                         <DatePicker
                                          placeholderText="MM/DD/YYYY"
                                          selected={this.state.startDate}
                                          onChange={this.handleChangeDate}
                                        />        
                                </FormGroup>
                              </Form>
                        </div>
                     </Card.Text>
            </Card.Body>
        </Card>
        {/* card of player two ends */}
 </CardColumns>
 </div>

    );
 }

}
export default CWO;
